    "2016-07-27T22:52:27.882946",nt"name": "ninepipe-and-pablo-national-wildlife-refuges-narrative-report-fiscal-year-1975-july-1-1-30",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Ninepipe
    National Wildlife Refuge outlines Refuge accomplishments during the 1975 fiscal
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    raptors, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments and vegetation control. Resource management is outlined;
    topics include grazing. A progress report on field investigations and applied research
    is also provided. The public relations section discusses recreational uses and violations.
    N-R forms are attached.",nt"license_title": "License Not Specified",nt"extras":
